import React from "react";
import Card from "react-bootstrap/Card"
import YoutubeEmbed from "../EmbedVid/Video";

function Cards() {
    return (
        <div>
            <Card>
                <div>
                    <YoutubeEmbed embedId="jRyo0uxQ5DE" />
                </div>
            </Card>
        </div>
    );
}

export default Cards;
